import{V as a}from"./chunks/theme.8a749cb9.js";import{o as t,c as o,H as r,l as e,Q as i}from"./chunks/framework.c6da5a4c.js";import{C as s}from"./chunks/team.abef0ced.js";const n=i('<h1 id="what-is-the-oxc-project" tabindex="-1">What is the Oxc Project? <a class="header-anchor" href="#what-is-the-oxc-project" aria-label="Permalink to &quot;What is the Oxc Project?&quot;">​</a></h1><p>The JavaScript Oxidation Compiler Project is a collection of high-performance tools for the JavaScript language written in Rust.</p><p>We are building JavaScript compiler tools such as parser, linter, formatter, transpiler, minifier and resolver.</p><p>We are also supporting new JavaScript tools such as Rspack, Rolldown and Ezno.</p><p>Our goal is to create and empower tooling for <a href="https://www.swyx.io/js-third-age" target="_blank" rel="noreferrer">The Third Age of JavaScript</a>.</p><h2 id="philosophy" tabindex="-1">Philosophy <a class="header-anchor" href="#philosophy" aria-label="Permalink to &quot;Philosophy&quot;">​</a></h2><p>This project shares the same philosophies as <a href="https://biomejs.dev" target="_blank" rel="noreferrer">Biome</a> and <a href="https://beta.ruff.rs" target="_blank" rel="noreferrer">Ruff</a>.</p><ol><li>JavaScript tooling could be rewritten in a more performant language.</li><li>An integrated toolchain can tap into efficiencies that are not available to a disparate set of tools.</li></ol><h2 id="team" tabindex="-1">Team <a class="header-anchor" href="#team" aria-label="Permalink to &quot;Team&quot;">​</a></h2>',9),f=JSON.parse('{"title":"Introduction","description":"","frontmatter":{"title":"Introduction","outline":"deep"},"headers":[],"relativePath":"zh/docs/guide/introduction.md","filePath":"zh/docs/guide/introduction.md"}'),l={name:"zh/docs/guide/introduction.md"},_=Object.assign(l,{setup(h){return(c,p)=>(t(),o("div",null,[n,r(e(a),{size:"medium",members:e(s)},null,8,["members"])]))}});export{f as __pageData,_ as default};
